import React from 'react';
import songs from '../data/DataSong';
import SongRow from '../songRow/SongRow';
import "./SongList.css"

const SongList = ({ songs }) => {
  return (
    <div className="song-list">
      {songs.map((song) => (
        <SongRow key={song.trackNumber} song={song} />
      ))}
    </div>
  );
}

export default SongList;
